import React from "react";
import ReactDOM from "react-dom";

const name = "Afnan";
const img1 = "https://images.pexels.com/photos/14030389/pexels-photo-14030389.jpeg?auto=compress&cs=tinysrgb&w=600&lazy=load";

ReactDOM.render(
    <>
        <h1 contentEditable="true"> Hello, My Name is {name}</h1>
        <img src={img1} />
    </>,
    document.getElementById("root")
);
